import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";

function Signup() {
  // Define all the states for form fields
  const [username, setUsername] = useState("");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [subject, setSubject] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("teacher");
  const [loading, setLoading] = useState(false); // For submit button state
  const [signupSuccess, setSignupSuccess] = useState(false);
  const [errorMessage, setErrorMessage] = useState(""); // For inline error messages
  const navigate = useNavigate();

  // Handle signup submission
  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevent form reload
    setLoading(true); // Show loading state during request
    setErrorMessage(""); // Clear error message

    try {
      // Prepare the data payload to be sent to the backend
      const signupData = {
        username,
        name,
        email,
        subject: role === "eacher" ? subject : undefined, // Only send subject if the user is a teacher
        password,
        role,
      };

      // Make an API call to the Flask backend's signup endpoint
      const response = await axios.post(
        "http://localhost:5555/signup",
        signupData
      );

      // If signup is successful, redirect the user to the login page after 2 seconds
      if (response.status === 201) {
        setSignupSuccess(true);
        setLoading(false);
        setTimeout(() => navigate("/login"), 2000); // Redirect after success
      }
    } catch (error) {
      // If error occurs, display the error message
      setLoading(false);
      setErrorMessage(error.response?.data?.message || "Error signing up");
    }
  };

  return (
    <div className="card signup-card">
      <form onSubmit={handleSubmit}>
        <h2>Sign Up</h2>
        {errorMessage && <p className="error-message">{errorMessage}</p>}{" "}
        {/* Display error message */}
        <label>Username: </label>
        <input
          type="text"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
        />
        <label>Email: </label>
        <input
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <label>Name: </label>
        <input
          type="text"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        {/* Only show the subject field if the user selects the "Teacher" role */}
        {role === "teacher" && (
          <>
            <label>Subject: </label>
            <input
              type="text"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
              required
            />
          </>
        )}
        <label>Password: </label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <label>Role: </label>
        <select value={role} onChange={(e) => setRole(e.target.value)}>
          <option value="teacher">Teacher</option>
          <option value="parent">Parent</option>
        </select>
        <button type="submit" disabled={loading}>
          {loading ? "Signing Up..." : "Sign Up"}
        </button>
        {signupSuccess && (
          <div className="success-message">
            <p>Signup successful! Redirecting to login...</p>
          </div>
        )}
      </form>
      <p>
        Already have an account? <Link to="/login">Login</Link>
      </p>
    </div>
  );
}

export default Signup;
